import React from 'react'

function Loader() {
  return (
    <svg
      xmlns='http://www.w3.org/2000/svg'
      xmlnsXlink='http://www.w3.org/1999/xlink'
      width='105'
      height='105'
      viewBox='0 0 105 105'
      className='centersvg spin'
      id='loader'>
      <image
        width='100'
        height='100'
        x='4'
        y='4'
        xlinkHref='data:img/png;base64,'></image>
    </svg>
  )
}

export default Loader
